import React,{Component} from 'react';
import './auth.scss'
export default class Auth extends Component{
    render(){
        return(

            <div className="auth">
                <div className="auth-inner">
                    <h2>Authorization</h2>
                    <label>Account:</label><input></input>
                    <label>Password:</label><input></input>
                </div>

            </div>


            )
    } 
}
